import React from "react";
import DeleteIcon from "@material-ui/icons/Delete";

function Note({ onDelete, id, title, content }) {
  function handleClick() {
    console.log("del");
    onDelete(id);
  }

  return (
    <div className="note">
      <h1>{title}</h1>
      <p>{content}</p>
      <button onClick={handleClick}>
        <DeleteIcon />
      </button>
    </div>
  );
}

export default Note;
